import React from 'react';
import "./AnnualReport.css"
  
const AnnualReport = () => {
  return (
    <div>
      <h1 className='ab-text'>About project</h1>
      <div>
      <p className='p-text'>Cryptographic farming is a professional blockchain platform. Here we will provide you only interesting content, which you will like very much. We're dedicated to providing you the best of Blockchain, with a focus on dependability and ReFi. We're working to turn our passion for Blockchain into a booming online website. We hope you enjoy our Blockchain as much as we enjoy offering them to you. I will keep posting more important posts on my Website for all of you. Please give your support and love. Thanks For Visiting Our Site Have a nice day!</p>
      </div>
      <p className='p-text1'>Contact Us:
         Phone No. +91 9940925919 , +91 9042751198 , +91 9360593133 <br></br>
       Email Id: manish.mc20@bitsathy.ac.in , abishek.mc20@bitsathy.ac.in , mohamedfarhun.it20@bitsathy.ac.in
       </p>
    </div>
  );
};
  
export default AnnualReport;
